import React, {Component} from 'react'


class DogsList extends Component {

    render() {
        const listObj = this.props.list;
        console.log(listObj);
        const listArr = [];
        for (var propName in listObj) {

            if(listObj[propName].length > 0) {
                console.log(1);
                let subBreeds = 
                        listObj[propName]
                            .map(subBreed => (
                                <a href="#" key ={subBreed.toString()} className="list-group-item">
                                    {subBreed}
                                </a>
                            ));

                let item = 
                    <a href="#" key = {propName.toString()}>
                    {propName + ':'} <br/>
                        <div className="list-group">
                            {subBreeds}
                        </div>
                    </a>;
                listArr.push(item);
            } else {
                console.log(2);
                let item = 
                <a href="#" key = {propName.toString()} className="list-group-item">
                    {propName}
                </a>;
                listArr.push(item);
            }
        }

        return (
            <div className="list-group">
                {listArr}
            </div>
        )
    }

}

export default DogsList;
